import { FETCH_MOVIE } from "../actions/types";

// const INICIAL_STATE = {
//   isSignedIn: null,
//   userId: null
// };

export default (state = [], action) => {
  switch (action.type) {
    case FETCH_MOVIE:
      return { ...state, movies: action.payload };
    default:
      return state;
  }
};
